package fb_recent;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class AllAnagrams {
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> resultIndices = new ArrayList<>();
        if (p.length() > s.length()) return resultIndices;
        int windowSize = p.length();
        Map<Character, Integer> pChars = getCharacterIntegerMap(p, p.length());

        Map<Character, Integer> substringMap = getCharacterIntegerMap(s, windowSize);
        // if substring contains all of the chars in p, its a match!
        if (pChars.equals(substringMap)) {
            resultIndices.add(0);
        }

        for (int i = 1; (i + windowSize) <= s.length(); i++) {
            // remove old char that we lost by moving the window
            char previousCharRemoved = s.charAt(i - 1);
            int valPrevChar = substringMap.get(previousCharRemoved) - 1;
            if (valPrevChar == 0) {
                substringMap.remove(previousCharRemoved);
            } else {
                substringMap.put(previousCharRemoved, valPrevChar);
            }

            // add new char that we gained by moving the window
            char newCharAdded = s.charAt(i + windowSize - 1);
            substringMap.put(newCharAdded, substringMap.getOrDefault(newCharAdded, 0) + 1);

            if (pChars.equals(substringMap)) {
                resultIndices.add(i);
            }
        }

        return resultIndices;
    }

    private Map<Character, Integer> getCharacterIntegerMap(String s, int windowSize) {
        Map<Character, Integer> substringMap = new HashMap<>();
        String substring = s.substring(0, windowSize);
        for (Character c: substring.toCharArray()) {
            substringMap.put(c, substringMap.getOrDefault(c, 0)  + 1);
        }
        return substringMap;
    }

    public static void main(String[] args){
        AllAnagrams allAnagrams = new AllAnagrams();
        System.out.println(allAnagrams.findAnagrams("cbaebabacd", "abc"));
        System.out.println(allAnagrams.findAnagrams("abab", "ab"));
        System.out.println(allAnagrams.findAnagrams("", ""));
    }
}
